    // verification for pan..
    LabourContractorRegistrationComponent.prototype.panVerification = function (panNo, companyName, ownerName, lcId) {
        var _this = this;
        var responseFlag = false;
        if (panNo.length == 10) {
            var compName_1 = companyName.toUpperCase().trim().split(' ')[0];
            var owner_1 = ownerName.toUpperCase().trim().split(' ')[0];
            return new Promise(function (resolve) {
                _this.labourService.postRequest('verify-pan-prod/', { 'pan_no': panNo }).subscribe(function (res) {
                    var responseCode = res.response_code;
                    var errorObject = {
                        document_type: "pan",
                        id_number: panNo,
                        reason: res.response_code + "-" + res.response_msg,
                        lab_contractor: lcId
                    };
                    switch (+responseCode) {
                        case 99:
                        case 100:
                        case 104:
                        case 105: {
                            _this.labourService.postRequest('create-failed-verfication-api/', errorObject).subscribe(function (res) {
                                console.log('res', res);
                            });
                            _this.showPopUpMsg('exceptionMessages.commonVerificationOops', true);
                            resolve(responseFlag = false);
                        }
                        case 101:
                            if (res.data.pan_status == "VALID") {
                                if (res.data.name.trim().split(' ')[0].toUpperCase() == compName_1 || res.data.name.trim().split(' ')[0].toUpperCase() == owner_1) {
                                    resolve(responseFlag = true);
                                }
                                else {
                                    _this.showPopUpMsg('exceptionMessages.panVerificationName', true);
                                    resolve(responseFlag = false);
                                }
                            }
                            break;
                        case 102:
                        case 103:
                        case 110:
                            _this.labourService.postRequest('create-failed-verfication-api/', errorObject).subscribe(function (res) {
                                console.log('res', res);
                            });
                            _this.showPopUpMsg('exceptionMessages.panVerificationIncorrect', true);
                            resolve(responseFlag = false);
                    }
                }, function (error) {
                    _this.formLoader = false;
                    _this.showPopUpMsg('exceptionMessages.somethingWentWrong', true);
                });
            });
        }
    };
    // gst verification..
    LabourContractorRegistrationComponent.prototype.gstVerification = function (gstNo, companyName, ownerName, lcId) {
        var _this = this;
        var responseFlag = false;
        if (gstNo.length == 15) {
            return new Promise(function (resolve) {
                _this.labourService.postRequest('verify-gst-prod/', { 'gst_no': gstNo }).subscribe(function (res) {
                    if (res) {
                        var responseCode = res.response_code;
                        var errorObject = {
                            document_type: "gst",
                            id_number: gstNo,
                            reason: res.response_code + "-" + res.response_msg,
                            lab_contractor: lcId
                        };
                        switch (+responseCode) {
                            case 99:
                            case 100:
                            case 104:
                            case 105:
                                _this.labourService.postRequest('create-failed-verfication-api/', errorObject).subscribe(function (res) {
                                    console.log('res', res);
                                });
                                _this.showPopUpMsg('exceptionMessages.commonVerificationOops', true);
                                resolve(responseFlag = false);
                                break;
                            case 101:
                                if (res.result) {
                                    if (res.result.tradeNam.trim().split(' ')[0].toUpperCase() != companyName.toUpperCase().trim().split(' ')[0]) {
                                        _this.showPopUpMsg('exceptionMessages.gstVerificationName', true);
                                        resolve(responseFlag = false);
                                    }
                                    else {
                                        resolve(responseFlag = true);
                                    }
                                }
                                break;
                            case 102:
                            case 103:
                            case 110:
                                _this.labourService.postRequest('create-failed-verfication-api/', errorObject).subscribe(function (res) {
                                    console.log('res', res);
                                });
                                _this.showPopUpMsg('exceptionMessages.gstVerificationIncorrect', true);
                                resolve(responseFlag = false);
                        }
                    }
                });
            });
        }
    };
    // random string generator
    LabourContractorRegistrationComponent.prototype.generateRandomString = function (strLength) {
        var result = '';
        var characters = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz';
        var charactersLength = characters.length;
        for (var i = 0; i < strLength; i++) {
            result += characters.charAt(Math.floor(Math.random() * charactersLength));
        }
        return result;
    };
    // random number generator..
    LabourContractorRegistrationComponent.prototype.generateRandomNumber = function (num1, num2) {
        return Math.floor(num1 + Math.random() * num2);
    };
